import weatherCard from "./weatherCard";
import "./style.css";

const Temp = () => {
  const [searchItem, setSearchItem] = useState("Pune");

  const getSearch = async () => {
    try {
      let url = `https://api.openweathermap.org/data/2.5/weather?q=${searchItem}&units=metric&appid=034e121c60473cd287f7184f326c0ff5`;

      const res=await fetch(url)
      const data=await res.json()
      console.log(data)

    } catch (e) {
      console.log(e);
    }
  };

  useEffect(() => {
    getSearch();
  }, []);

  return (
    <>
      <div className="wrap">
        <div className="search">
          <input
            type="search"
            placeholder="search..."
            autoFocus
            id="search"
            className="searchTerm"
            value={searchItem}
            onChange={(e) => setSearchItem(e.target.value)}
          />

          <button className="searchButton" type="button" onClick={getSearch}>
            Search
          </button>
        </div>
      </div>

      weather

    </>
  );
};

export default Temp;
